// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

//import "./ERC1948/ERC1948.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract IntelligibleCertificate is ERC721 {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIds;

    constructor(string memory name, string memory symbol)
        public
        ERC721(name, symbol)
    {}

    function newCertificate(address receivingAddress, string memory tokenURI)
        public
        returns (uint256)
    {
        uint256 newItemId = _newToken(receivingAddress, tokenURI);

        return newItemId;
    }

    function _newToken(address receivingAddress, string memory tokenURI)
        private
        returns (uint256)
    {
        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(receivingAddress, newItemId);
        _setTokenURI(newItemId, tokenURI);

        return newItemId;
    }

    // Freeze the token transfer -> alternative = Pausable

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {}

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) public virtual override {}
}
